import React from "react";
import Box2 from "./Box2";
import styled from "styled-components";
const Box1 = () => {
  const Box2 = styled.div`
    position: absolute;
    background: red;
    height: 400px;
    width: 400px;
    top: 50%;
    left: 50%;
    transform: translate(-50%, -50%);
  `;
  return (
    <div className="box1">
      <Box2></Box2>
    </div>
  );
};

export default Box1;
